    false,nt"url": null,nt"notes": "These data were created as part of the
    National Oceanic and Atmospheric Administration Office for Coastal Management's
    efforts to create an online mapping viewer called the Sea Level Rise and Coastal
    Flooding Impacts Viewer. It depicts potential sea level rise and its associated
    impacts on the nation's coastal areas. The purpose of the mapping viewer is to provide
    coastal managers and scientists with a preliminary look at sea level rise (slr)
    and coastal flooding impacts. The viewer is a screening-level tool that uses nationally
    consistent data sets and analyses. Data and maps provided can be used at several
    scales to help gauge trends and prioritize actions for different scenarios. The
    Sea Level Rise and Coastal Flooding Impacts Viewer may be accessed at: http://www.coast.noaa.gov/slr
    This digital elevation model (DEM) is a part of a series of DEMs produced for the
    National Oceanic and Atmospheric Administration Office for Coastal Management's
    Sea Level Rise and Coastal Flooding Impacts Viewer described above. The DEM created
    for this project was developed using the NOAA National Weather Service's Weather
    Forecast Office (WFO) boundaries. This DEM includes the best available lidar data
    known to exist at the time of DEM creation that met project specifications, for
    Maryland, west of the Chesapeake Bay. This DEM falls in the Baltimore/Washington
    (LWX) WFO. The DEM covers the following Maryland counties: Baltimore City (portion),
    Howard (portion), Anne Arundel, Charles, and St. Mary's. This DEM does not include
    the counties that are also in the LWX WFO of Baltimore, Calvert, and Harford. This
    is because the lidar data for these counties are licensed and unavailable for distribution
    to the general public. As such, the extent of this DEM is different than that of
    the DEM used by the NOAA Office for Coastal Management in creating the inundation
    data seen in the Sea Level Rise and Coastal Impacts Viewer (www.coast.noaa.gov/slr/viewer).
    This DEM is derived from multiple lidar datasets furnished by NOAA, the United States
    Army Corps of Engineers (USACE), and the United States Geological Survey (USGS).
    A list of lidar data sources can be found in the Process Lineage. Hydrographic breaklines
    were delineated using lidar intensity imagery generated from the lidar. The DEM
    is hydro flattened such that water elevations are less than or equal to 0 meters.
    The DEM is referenced vertically to the North American Vertical Datum of 1988 (NAVD88)
    with vertical units of meters and horizontally to the North American Datum of 1983
    (NAD83). The resolution of the DEM is approximately 10 meters.",nt"owner_org":
